INSERT INTO `cache_field` VALUES ('field:node:1','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1277:\"<table>\r\n  <tr>\r\n    <td>Studienmodule</td>\r\n    <td>Informationen zum Studienaufbau finden Sie <a href=\"https://www.uni-hildesheim.de/media/zsb/Studienangebot/Bachelorstudium/Wirtschaftsinformatik/brosch_bscwinf.pdf\">hier.</a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Studiendauer</td>\r\n    <td>6 Semester</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Vorraussetzungen</td>\r\n    <td>Abitur oder ein als gleichwertig anerkannter Abschluss. <a href=\"https://www.uni-hildesheim.de/qm/processmanagement/download.php?fileID=4473\">Weitere Informationen</a>. </td>\r\n  </tr>\r\n  <tr>\r\n    <td>Sprache</td>\r\n    <td>Deutsch</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Semesterbeitrag</td>\r\n    <td>371,67 Euro. <a href=\"https://www.uni-hildesheim.de/dez3/immatrikulationsamt/rueckmeldung-fuer-das-sommersemester-2017/\">Weitere Informationen. </a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Studienbeginn</td>\r\n    <td>Jeweils zum Sommer- und Wintersemester.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Abschlussart</td>\r\n    <td>Bachelor of Science B.Sc.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Bewerbung</td>\r\n    <td>Informationen zur Bewerbung finden Sie <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\"> hier.</a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Anschließende Master</td>\r\n    <td>Master Wirtschaftsinformatik.</td>\r\n  </tr>\r\n</table>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1113:\"<table><tr><td>Studienmodule</td>\n<td>Informationen zum Studienaufbau finden Sie <a href=\"https://www.uni-hildesheim.de/media/zsb/Studienangebot/Bachelorstudium/Wirtschaftsinformatik/brosch_bscwinf.pdf\">hier.</a></td>\n</tr><tr><td>Studiendauer</td>\n<td>6 Semester</td>\n</tr><tr><td>Vorraussetzungen</td>\n<td>Abitur oder ein als gleichwertig anerkannter Abschluss. <a href=\"https://www.uni-hildesheim.de/qm/processmanagement/download.php?fileID=4473\">Weitere Informationen</a>. </td>\n</tr><tr><td>Sprache</td>\n<td>Deutsch</td>\n</tr><tr><td>Semesterbeitrag</td>\n<td>371,67 Euro. <a href=\"https://www.uni-hildesheim.de/dez3/immatrikulationsamt/rueckmeldung-fuer-das-sommersemester-2017/\">Weitere Informationen. </a></td>\n</tr><tr><td>Studienbeginn</td>\n<td>Jeweils zum Sommer- und Wintersemester.</td>\n</tr><tr><td>Abschlussart</td>\n<td>Bachelor of Science B.Sc.</td>\n</tr><tr><td>Bewerbung</td>\n<td>Informationen zur Bewerbung finden Sie <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\"> hier.</a></td>\n</tr><tr><td>Anschließende Master</td>\n<td>Master Wirtschaftsinformatik.</td>\n</tr></table>\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494999412,1),('field:node:10','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1002:\"Die Regelstudienzeit im Bachelor-Studium Wirtschaftsinformatik an der Universität Hildesheim beläuft sich auf insgesamt sechs Semester. Innerhalb der ersten vier Studienhalbjahren wird der Fokus auf die Vermittlung der Grundlagen gelegt. Neben den bereits genannten Oberthemen im vorherigen Absatz werden auch mathematische Grundlagen gelehrt, die aus insgesamt drei Abschnitten bestehen. \r\nNach dem Grundlagen-Teil gibt es die Möglichkeit, im Rahmen eines zehnwöchigen Pflichtpraktikums die gelernten Studieninhalte bei einem der insgesamt rund 40 Partnerunternehmen der Universität praktisch anzuwenden. Oft besteht im Anschluss die Möglichkeit auf eine Werkstudententätigkeit oder auch eine Kooperation mit dem Unternehmen bei der Fertigung der dreimonatigen Bachelor-Arbeit, mit der das Studium abgeschlossen wird. Neben dem Pflichtpraktikum kann zwischen vielen verschiedenen weiteren Kursen gewählt werden, um sich bereits im Bachelor-Studiengang auf ein Themengebiet zu spezialisieren.\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1012:\"<p>Die Regelstudienzeit im Bachelor-Studium Wirtschaftsinformatik an der Universität Hildesheim beläuft sich auf insgesamt sechs Semester. Innerhalb der ersten vier Studienhalbjahren wird der Fokus auf die Vermittlung der Grundlagen gelegt. Neben den bereits genannten Oberthemen im vorherigen Absatz werden auch mathematische Grundlagen gelehrt, die aus insgesamt drei Abschnitten bestehen.<br />\nNach dem Grundlagen-Teil gibt es die Möglichkeit, im Rahmen eines zehnwöchigen Pflichtpraktikums die gelernten Studieninhalte bei einem der insgesamt rund 40 Partnerunternehmen der Universität praktisch anzuwenden. Oft besteht im Anschluss die Möglichkeit auf eine Werkstudententätigkeit oder auch eine Kooperation mit dem Unternehmen bei der Fertigung der dreimonatigen Bachelor-Arbeit, mit der das Studium abgeschlossen wird. Neben dem Pflichtpraktikum kann zwischen vielen verschiedenen weiteren Kursen gewählt werden, um sich bereits im Bachelor-Studiengang auf ein Themengebiet zu spezialisieren.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494998230,1),('field:node:11','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:758:\"Mit einem Abschluss in Wirtschaftsinformatik können Sie in den unterschiedlichsten Berufszweigen tätig werden, z.B. in den folgenden Bereichen:\r\n<ul>\r\n<li>Controlling und Management von IT-Projekten</li>\r\n<li>Software- und Systemanalyse</li>\r\n<li>Entwicklung betrieblicher Anwendungssysteme</li>\r\n<li>Betreuung der Einführung wirtschaftlicher Anwendungssysteme</li>\r\n<li>Unternehmensberatung und -consulting</li>\r\n<li>IT-Produktmarketing und -management</li>\r\n</ul>\r\nDie Berufsaussichten für Absolvent_innen des Studiengangs Wirtschaftsinformatik sind sehr gut. Mitarbeiter_innen mit entsprechenden Qualifikationen werden von der Wirtschaft intensiv gesucht. Die Zahl offener Stellen übersteigt die Zahl passender Bewerber_innen teils um ein Mehrfaches.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:762:\"<p>Mit einem Abschluss in Wirtschaftsinformatik können Sie in den unterschiedlichsten Berufszweigen tätig werden, z.B. in den folgenden Bereichen:</p>\n<ul><li>Controlling und Management von IT-Projekten</li>\n<li>Software- und Systemanalyse</li>\n<li>Entwicklung betrieblicher Anwendungssysteme</li>\n<li>Betreuung der Einführung wirtschaftlicher Anwendungssysteme</li>\n<li>Unternehmensberatung und -consulting</li>\n<li>IT-Produktmarketing und -management</li>\n</ul><p>Die Berufsaussichten für Absolvent_innen des Studiengangs Wirtschaftsinformatik sind sehr gut. Mitarbeiter_innen mit entsprechenden Qualifikationen werden von der Wirtschaft intensiv gesucht. Die Zahl offener Stellen übersteigt die Zahl passender Bewerber_innen teils um ein Mehrfaches.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494998413,1),('field:node:12','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:311:\"Für ein erfolgreiches Studium der Wirtschaftsinformatik sind im Vorfeld keine Kenntnisse der Betriebswirtschaft oder Informatik nötig. Die Mathematik-Kenntnisse sollten sich auf Abitur-Niveau befinden, wobei die Universität hier zusätzliche Mathematik-Vorkurse zum „Auffrischen“ der Kenntnisse anbietet.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:319:\"<p>Für ein erfolgreiches Studium der Wirtschaftsinformatik sind im Vorfeld keine Kenntnisse der Betriebswirtschaft oder Informatik nötig. Die Mathematik-Kenntnisse sollten sich auf Abitur-Niveau befinden, wobei die Universität hier zusätzliche Mathematik-Vorkurse zum „Auffrischen“ der Kenntnisse anbietet.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1495000384,1),('field:node:13','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:271:\"Prof. Dr. Ralf Knackstedt\r\nTel: +49 (0) 5121 883-40602\r\nEmail: ralf.knackstedt[at]uni-hildesheim.de\r\n<a href=\"https://www.uni-hildesheim.de/fb4/institute/bwl/informationssysteme-und-unternehmensmodellierung/mitglieder/professor/professor-dr-ralf-knackstedt/\">Webseite</a>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:293:\"<p>Prof. Dr. Ralf Knackstedt<br />\nTel: +49 (0) 5121 883-40602<br />\nEmail: ralf.knackstedt[at]uni-hildesheim.de<br /><a href=\"https://www.uni-hildesheim.de/fb4/institute/bwl/informationssysteme-und-unternehmensmodellierung/mitglieder/professor/professor-dr-ralf-knackstedt/\">Webseite</a></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1495000339,1),('field:node:2','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:567:\"Hildesheim liegt ca. 30 Kilometer südlich der niedersächsischen Landeshauptstadt Hannover und besitzt rund 100.000 Einwohner. Die Stadt ist Standort von insgesamt drei Hochschulen, was sie zu einer richtigen Studentenstadt macht. Neben dem guten Wohnungsangebot sowohl für neue als auch für alle anderen Studenten besteht eine Vielzahl von Freizeitaktivitäten. In der Innenstadt existieren viele Bars, die zu einem gemütlichen Abend einladen und für die Partygänger öffnet eine große Diskothek mitten in der Stadt von Donnerstag bis Samstag ihre Pforten. \r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:572:\"<p>Hildesheim liegt ca. 30 Kilometer südlich der niedersächsischen Landeshauptstadt Hannover und besitzt rund 100.000 Einwohner. Die Stadt ist Standort von insgesamt drei Hochschulen, was sie zu einer richtigen Studentenstadt macht. Neben dem guten Wohnungsangebot sowohl für neue als auch für alle anderen Studenten besteht eine Vielzahl von Freizeitaktivitäten. In der Innenstadt existieren viele Bars, die zu einem gemütlichen Abend einladen und für die Partygänger öffnet eine große Diskothek mitten in der Stadt von Donnerstag bis Samstag ihre Pforten.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494998446,1),('field:node:4','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:428:\"<p>Der Studiengang ist zulassungsbeschränkt, d. h., Sie müssen sich um einen Studienplatz bewerben. Die Bewerbung erfolgt über das Online-Bewerbungsportal ab Anfang Juni (zum Wintersemester) und ab Anfang Dezember (zum Sommersemester). Weitere Informationen finden Sie unter folgendem Link auf der Seite <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\" target=\"_blank\">Bewerbung um einen Studienplatz</a>.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:433:\"<p>Der Studiengang ist zulassungsbeschränkt, d. h., Sie müssen sich um einen Studienplatz bewerben. Die Bewerbung erfolgt über das Online-Bewerbungsportal ab Anfang Juni (zum Wintersemester) und ab Anfang Dezember (zum Sommersemester). Weitere Informationen finden Sie unter folgendem Link auf der Seite <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\" target=\"_blank\">Bewerbung um einen Studienplatz</a>.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494942498,1),('field:node:5','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:28:\"<a href=\"#node1\">Studium</a>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:36:\"<p><a href=\"#node1\">Studium</a></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494942971,1),('field:node:6','a:2:{s:4:\"body\";a:0:{}s:19:\"field_landing_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"2\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:54:\"160623-uni neubau 01 _Foto Clemens Heidrich.small_.jpg\";s:3:\"uri\";s:63:\"public://160623-uni neubau 01 _Foto Clemens Heidrich.small_.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:7:\"1831649\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1494942997\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s: