 sich auf der einen Seite vor allem mit der Konzeption von Informationssystemen und dem dazugehörigen Entwickeln von verschiedensten Formen von Prozessen, um das System nachhaltig stabilisieren zu können. Auf der anderen Seite taucht die WI in die allgemeine Betriebswirtschaftslehre ein und beschäftigt sich hier unter anderem mit den Bereichen Marketing, Produktion und Logistik. Innerhalb eines dritten Zweiges dreht sich alles um das Thema Informatik, welches besonderes Augenmerk auf die Programmierung, das Software Engineering oder das Maschinelle Lernen lenkt.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:19:\"field_landing_image\";a:0:{}}',0,1494998195,1),('field:user:1','a:0:{}',0,1494942496,1),('field_info:bundle:node:page','a:2:{s:9:\"instances\";a:2:{s:4:\"body\";a:13:{s:5:\"label\";s:4:\"Body\";s:6:\"widget\";a:4:{s:4:\"type\";s:26:\"text_textarea_with_summary\";s:8:\"settings\";a:2:{s:4:\"rows\";i:20;s:12:\"summary_rows\";i:5;}s:6:\"weight\";s:2:\"-4\";s:6:\"module\";s:4:\"text\";}s:8:\"settings\";a:3:{s:15:\"display_summary\";b:1;s:15:\"text_processing\";i:1;s:18:\"user_register_form\";b:0;}s:7:\"display\";a:2:{s:7:\"default\";a:5:{s:5:\"label\";s:6:\"hidden\";s:4:\"type\";s:12:\"text_default\";s:8:\"settings\";a:0:{}s:6:\"module\";s:4:\"text\";s:6:\"weight\";i:0;}s:6:\"teaser\";a:5:{s:5:\"label\";s:6:\"hidden\";s:4:\"type\";s:23:\"text_summary_or_trimmed\";s:8:\"settings\";a:1:{s:11:\"trim_length\";i:600;}s:6:\"module\";s:4:\"text\";s:6:\"weight\";i:0;}}s:8:\"required\";b:0;s:11:\"description\";s:0:\"\";s:2:\"id\";s:1:\"2\";s:8:\"field_id\";s:1:\"2\";s:10:\"field_name\";s:4:\"body\";s:11:\"entity_type\";s:4:\"node\";s:6:\"bundle\";s:4:\"page\";s:7:\"deleted\";s:1:\"0\";s:13:\"default_value\";N;}s:19:\"field_landing_image\";a:12:{s:5:\"label\";s:4:\"bild\";s:6:\"widget\";a:5:{s:6:\"weight\";s:2:\"-3\";s:4:\"type\";s:11:\"image_image\";s:6:\"module\";s:5:\"image\";s:6:\"active\";i:1;s:8:\"settings\";a:2:{s:18:\"progress_indicator\";s:8:\"throbber\";s:19:\"pre