set autocommit=0;
INSERT INTO `field_revision_body` VALUES ('node','page',0,1,1,'und',0,'<table>\r\n  <tr>\r\n    <td>Studienmodule</td>\r\n    <td>Informationen zum Studienaufbau finden Sie <a href=\"https://www.uni-hildesheim.de/media/zsb/Studienangebot/Bachelorstudium/Wirtschaftsinformatik/brosch_bscwinf.pdf\">hier.</a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Studiendauer</td>\r\n    <td>6 Semester</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Vorraussetzungen</td>\r\n    <td>Abitur oder ein als gleichwertig anerkannter Abschluss. <a href=\"https://www.uni-hildesheim.de/qm/processmanagement/download.php?fileID=4473\">Weitere Informationen</a>. </td>\r\n  </tr>\r\n  <tr>\r\n    <td>Sprache</td>\r\n    <td>Deutsch</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Semesterbeitrag</td>\r\n    <td>371,67 Euro. <a href=\"https://www.uni-hildesheim.de/dez3/immatrikulationsamt/rueckmeldung-fuer-das-sommersemester-2017/\">Weitere Informationen. </a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Studienbeginn</td>\r\n    <td>Jeweils zum Sommer- und Wintersemester.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Abschlussart</td>\r\n    <td>Bachelor of Science B.Sc.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Bewerbung</td>\r\n    <td>Informationen zur Bewerbung finden Sie <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\"> hier.</a></td>\r\n  </tr>\r\n  <tr>\r\n    <td>Anschließende Master</td>\r\n    <td>Master Wirtschaftsinformatik.</td>\r\n  </tr>\r\n</table>','','full_html'),('node','page',0,2,2,'und',0,'Hildesheim liegt ca. 30 Kilometer südlich der niedersächsischen Landeshauptstadt Hannover und besitzt rund 100.000 Einwohner. Die Stadt ist Standort von insgesamt drei Hochschulen, was sie zu einer richtigen Studentenstadt macht. Neben dem guten Wohnungsangebot sowohl für neue als auch für alle anderen Studenten besteht eine Vielzahl von Freizeitaktivitäten. In der Innenstadt existieren viele Bars, die zu einem gemütlichen Abend einladen und für die Partygänger öffnet eine große Diskothek mitten in der Stadt von Donnerstag bis Samstag ihre Pforten. \r\n','','filtered_html'),('node','page',0,4,4,'und',0,'<p>Der Studiengang ist zulassungsbeschränkt, d. h., Sie müssen sich um einen Studienplatz bewerben. Die Bewerbung erfolgt über das Online-Bewerbungsportal ab Anfang Juni (zum Wintersemester) und ab Anfang Dezember (zum Sommersemester). Weitere Informationen finden Sie unter folgendem Link auf der Seite <a href=\"https://www.uni-hildesheim.de/studium/bewerbung/bewerbung/\" target=\"_blank\">Bewerbung um einen Studienplatz</a>.','','full_html'),('node','page',0,5,5,'und',0,'<a href=\"#node1\">Studium</a>','','filtered_html'),('node','page',0,8,8,'und',0,'Die Digitalisierung von Wirtschaft, Verwaltung und Gesellschaft schreitet unaufhaltsam voran. Ohne IT-Systeme können Unternehmen heute kaum noch existieren. Mit dem Bachelor-Abschluss Wirtschaftsinformatik der Universität Hildesheim gelten Sie als Experte auf diesem Gebiet. Durch die Möglichkeit von Praktika bei einem der vielen Partnerunternehmen der Universität haben Sie beste Karrierechancen. ','','filtered_html'),('node','page',0,9,9,'und',0,'Das Fach Wirtschaftsinformatik beschäftigt sich auf der einen Seite vor allem mit der Konzeption von Informationssystemen und dem dazugehörigen Entwickeln von verschiedensten Formen von Prozessen, um das System nachhaltig stabilisieren zu können. Auf der anderen Seite taucht die WI in die allgemeine Betriebswirtschaftslehre ein und beschäftigt sich hier unter anderem mit den Bereichen Marketing, Produktion und Logistik. Innerhalb eines dritten Zweiges dreht sich alles um das Thema Informatik, welches besonderes Augenmerk auf die Programmierung, das Software Engineering oder das Maschinelle Lernen lenkt.','','filtered_html'),('node','page',0,10,10,'und',0,'Die Regelstudienzeit im Bachelor-Studium Wirtschaftsinformatik an der Universität Hildesheim beläuft sich auf insgesamt sechs Semester. Innerhalb der ersten vier Studienhalbjahren wird der Fokus auf die Vermittlung der Grundlagen gelegt. Neben den bereits genannten Oberthemen im vorherigen Absatz werden auch mathematische Grundlagen gelehrt, die aus insgesamt drei Abschnitten bestehen. \r\nNach dem Grundlagen-Teil gibt es die Möglichkeit, im Rahmen eines zehnwöchigen Pflichtpraktikums die gelernten Studieninhalte bei einem der insgesamt rund 40 Partnerunternehmen der Universität praktisch anzuwenden. Oft besteht im Anschluss die Möglichkeit auf eine Werkstudententätigkeit oder auch eine Kooperation mit dem Unternehmen bei der Fertigung der dreimonatigen Bachelor-Arbeit, mit der das Studium abgeschlossen wird. Neben dem Pflichtpraktikum kann zwischen vielen verschiedenen weiteren Kursen gewählt werden, um sich bereits im Bachelor-Studiengang auf ein Themengebiet zu spezialisieren.\r\n','','filtered_html'),('node','page',0,11,11,'und',0,'Mit einem Abschluss in Wirtschaftsinformatik können Sie in den unterschiedlichsten Berufszweigen tätig werden, z.B. in den folgenden Bereichen:\r\n<ul>\r\n<li>Controlling und Management von IT-Projekten</li>\r\n<li>Software- und Systemanalyse</li>\r\n<li>Entwicklung betrieblicher Anwendungssysteme</li>\r\n<li>Betreuung der Einführung wirtschaftlicher Anwendungssysteme</li>\r\n<li>Unternehmensberatung und -consulting</li>\r\n<li>IT-Produktmarketing und -management</li>\r\n</ul>\r\nDie Berufsaussichten für Absolvent_innen des Studiengangs Wirtschaftsinformatik sind sehr gut. Mitarbeiter_innen mit entsprechenden Qualifikationen werden von der Wirtschaft intensiv gesucht. Die Zahl offener Stellen übersteigt die Zahl passender Bewerber_innen teils um ein Mehrfaches.','','filtered_html'),('node','page',0,12,12,'und',0,'Für ein erfolgreiches Studium der Wirtschaftsinformatik sind im Vorfeld keine Kenntnisse der Betriebswirtschaft oder Informatik nötig. Die Mathematik-Kenntnisse sollten sich auf Abitur-Niveau befinden, wobei die Universität hier zusätzliche Mathematik-Vorkurse zum „Auffrischen“ der Kenntnisse anbietet.','','filtered_html'),('node','page',0,13,13,'und',0,'Prof. Dr. Ralf Knackstedt\r\nTel: +49 (0) 5121 883-40602\r\nEmail: ralf.knackstedt[at]uni-hildesheim.de\r\n<a href=\"https://www.uni-hildesheim.de/fb4/institute/bwl/informationssysteme-und-unternehmensmodellierung/mitglieder/professor/professor-dr-ralf-knackstedt/\">Webseite</a>','','full_html');
/*!40000 ALTER TABLE `field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

