INSERT INTO `search_dataset` VALUES (1,'node',' studium studienmodule informationen zum studienaufbau finden sie hier studiendauer 6 semester vorraussetzungen abitur oder ein als gleichwertig anerkannter abschluss weitere informationen  sprache deutsch semesterbeitrag 37167 euro weitere informationen studienbeginn jeweils zum sommer und wintersemester abschlussart bachelor of science bsc bewerbung informationen zur bewerbung finden sie hier anschließende master master wirtschaftsinformatik  ',0),(2,'node',' studienort hildesheim liegt ca 30 kilometer südlich der niedersächsischen landeshauptstadt hannover und besitzt rund 100000 einwohner die stadt ist standort von insgesamt drei hochschulen was sie zu einer richtigen studentenstadt macht neben dem guten wohnungsangebot sowohl für neue als auch für alle anderen studenten besteht eine vielzahl von freizeitaktivitäten in der innenstadt existieren viele bars die zu einem gemütlichen abend einladen und für die partygänger öffnet eine große diskothek mitten in der stadt von donnerstag bis samstag ihre pforten  ',0),(4,'node',' bewerbung der studiengang ist zulassungsbeschränkt d h sie müssen sich um einen studienplatz bewerben die bewerbung erfolgt über das onlinebewerbungsportal ab anfang juni zum wintersemester und ab anfang dezember zum sommersemester weitere informationen finden sie unter folgendem link auf der seite bewerbung um einen studienplatz   ',0),(5,'node',' anchor studium ',0),(6,'node','  none  ',0),(8,'node',' bachelor wirtschaftsinformatik die digitalisierung von wirtschaft verwaltung und gesellschaft schreitet unaufhaltsam voran ohne itsysteme können unternehmen heute kaum noch existieren mit dem bachelorabschluss wirtschaftsinformatik der universität hildesheim gelten sie als experte auf diesem gebiet durch die möglichkeit von praktika bei einem der vielen partnerunternehmen der universität haben sie beste karrierechancen  ',0),(9,'node',' wirtschaftsinformatik das fach wirtschaftsinformatik beschäftigt sich auf der einen seite vor allem mit der konzeption von informationssystemen und dem dazugehörigen entwickeln von verschiedensten formen von prozessen um das system nachhaltig stabilisieren zu können auf der anderen seite taucht die wi in die allgemeine betriebswirtschaftslehre ein und beschäftigt sich hier unter anderem mit den bereichen marketing produktion und logistik innerhalb eines dritten zweiges dreht sich alles um das thema informatik welches besonderes augenmerk auf die programmierung das software engineering oder das maschinelle lernen lenkt  ',0),(10,'node',' studieninhalt die regelstudienzeit im bachelorstudium wirtschaftsinformatik an der universität hildesheim beläuft sich auf insgesamt sechs semester innerhalb der ersten vier studienhalbjahren wird der fokus auf die vermittlung der grundlagen gelegt neben den bereits genannten oberthemen im vorherigen absatz werden auch mathematische grundlagen gelehrt die aus insgesamt drei abschnitten bestehen nach dem grundlagenteil gibt es die möglichkeit im rahmen eines zehnwöchigen pflichtpraktikums die gelernten studieninhalte bei einem der insgesamt rund 40 partnerunternehmen der universität praktisch anzuwenden oft besteht im anschluss die möglichkeit auf eine werkstudententätigkeit oder auch eine kooperation mit dem unternehmen bei der fertigung der dreimonatigen bachelorarbeit mit der das studium abgeschlossen wird neben dem pflichtpraktikum kann zwischen vielen verschiedenen weiteren kursen gewählt werden um sich bereits im bachelorstudiengang auf ein themengebiet zu spezialisieren  ',0),(11,'node',' karrierechancen mit einem abschluss in wirtschaftsinformatik können sie in den unterschiedlichsten berufszweigen tätig werden zb in den folgenden bereichen controlling und management von itprojekten software und systemanalyse entwicklung betrieblicher anwendungssysteme betreuung der einführung wirtschaftlicher anwendungssysteme unternehmensberatung und consulting itproduktmarketing und management die berufsaussichten für absolventinnen des studiengangs wirtschaftsinformatik sind sehr gut mitarbeiterinnen mit entsprechenden qualifikationen werden von der wirtschaft intensiv gesucht die zahl offener stellen übersteigt die zahl passender bewerberinnen teils um ein mehrfaches  ',0),(12,'node',' vorraussetzungen für ein erfolgreiches studium der wirtschaftsinformatik sind im vorfeld keine kenntnisse der betriebswirtschaft oder informatik nötig die mathematikkenntnisse sollten sich auf abiturniveau befinden wobei die universität hier zusätzliche mathematikvorkurse zum auffrischen der kenntnisse anbietet  ',0),(13,'node',' ansprechpartner prof dr ralf knackstedt tel 49  5121 88340602 email ralfknackstedt at unihildesheimde webseite ',0);
/*!40000 ALTER TABLE `search_dataset` ENABLE KEYS */;
